## The code below will instantiate the course database! ##
DROP DATABASE IF EXISTS H_Furniture;
CREATE DATABASE IF NOT EXISTS H_Furniture;

USE H_Furniture;

CREATE TABLE IF	NOT	EXISTS `Size` (
  `size_id` int,
  `height` float,
  `width` float,
  `depth` float,
  `one_size` tinyint,
  `measurement_units` VARCHAR(255),
  `notes` VARCHAR(255),
  PRIMARY KEY (`size_id`)
);


CREATE TABLE IF	NOT	EXISTS `Color` (
  `color_id` int,
  `listed_color` text,
  `red` char(10),
  `blue` char(10),
  `black` char(10),
  `green` char(10),
  `yellow` char(10),
  `brown` char(10),
  `gray` char(10),
  `white` char(10),
  `other` char(10),
  PRIMARY KEY (`color_id`)
);



CREATE TABLE IF	NOT	EXISTS `Price` (
  `price_id` int,
  `original_price` int,
  `discounted_price` int,
  `black_friday_deal` tinyint,
  PRIMARY KEY (`price_id`)
);


CREATE TABLE IF	NOT	EXISTS `Brand` (
  `brand_id` int,
  `brand_name` VARCHAR(255),
  PRIMARY KEY (`brand_id`)
);


CREATE TABLE IF	NOT	EXISTS `Category` (
  `category_id` int,
  `category` VARCHAR(255),
  PRIMARY KEY (`category_id`)
);

CREATE TABLE IF	NOT	EXISTS `Review` (
  `review_id` int,
  `five_star` int,
  `four_star` int,
  `three_star` int,
  `two_star` int,
  `one_star` int,
  PRIMARY KEY (`review_id`)
);

-- review_id, five_star, four_star, three_star, two_star, one_star

CREATE TABLE IF	NOT	EXISTS `Product` (
  `product_id` int,
  `sku` varchar(25),
  `product_name` VARCHAR(255),
  `color_count` char(10),
  `size_count` char(10),
  `size_id` int,
  `price_id` int,
  `review_id` int,
  `brand_id` int,
  `color_id` int,
  PRIMARY KEY (`product_id`),
  FOREIGN KEY (`size_id`) REFERENCES `size`(`size_id`),
  FOREIGN KEY (`brand_id`) REFERENCES `brand`(`brand_id`),
  FOREIGN KEY (`price_id`) REFERENCES `Price`(`price_id`),
  FOREIGN KEY (`review_id`) REFERENCES `Review`(`review_id`),
  FOREIGN KEY (`color_id`) REFERENCES `Color`(`color_id`)
);

CREATE TABLE IF	NOT	EXISTS `ProCat` (
  `pc_id` int,
  `product_id` int,
  `category_id` int,
  PRIMARY KEY (`pc_id`),
  FOREIGN KEY (`category_id`) REFERENCES `category`(`category_id`),
  FOREIGN KEY (`product_id`) REFERENCES `Product`(`product_id`)
);


CREATE TABLE IF	NOT	EXISTS `Subcategory` (
  `subcategory_id` int AUTO_INCREMENT,
  `subcategory` VARCHAR(255),
  PRIMARY KEY (`subcategory_id`)
);

CREATE TABLE IF	NOT	EXISTS `CatSub` (
  `cat_sub_id` int AUTO_INCREMENT,
  `product_id` int,
  `subcategory_id` int,
  PRIMARY KEY (`cat_sub_id`),
  FOREIGN KEY (`product_id`) REFERENCES `Product`(`product_id`),
  FOREIGN KEY (`subcategory_id`) REFERENCES `subcategory`(`subcategory_id`)
);


